import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container: {
        backgroundColor: '#2b80ff',
        padding: 10,
        borderTopLeftRadius: 10,
        borderTopRightRadius: 10
    },
    title: {
        color: 'white',
        fontSize: 20,
        fontWeight: 'bold'
    },
    text: {
        color: 'white',
        fontSize: 15
    },
    learnMore: {
        
    }
});

export default styles;
